    <footer className="footer">
      <a href="mailto:proveedor@example.com" className="footer-link"><FaEnvelope size={24} /></a>
      <a href="https://wa.me/proveedor" className="footer-link"><FaWhatsapp size={24} /></a>
      <a href="https://www.instagram.com/proveedor/" className="footer-link"><FaInstagram size={24} /></a>
    </footer>
  );
};

export default Footer;
